import React from "react";
import axios from "axios";

axios
  .get("https://captaincoaster.com/api/coasters", {
    headers: {
      "Content-Type": "application/json",
      "X-Auth-Token": "ec0115b6-d035-41e0-a4d2-b4a76f968ef7",
    },
  })
  .then((res) => {
    console.log(res);
  });
// .catch((err) => setResponse(err));
